import React, { useEffect, useRef, useState } from 'react'
import { fetchUser } from './moks'

const App: React.FC<any> = () => {
  const [user, setUser] = useState(undefined)

  useEffect(() => {
    fetchUser('0').then(
      (response: any) => setUser(response),
      () => setUser(null),
    )
  }, [])

  return <div>{user ? user : 'Loading...'}</div>
}

export default App
